import logo from './logo.svg';
import './App.css';
import {Helmet} from "react-helmet";


function App() {
  return (
    <div className="App">
      <Helmet>
        <meta charSet="utf-8" />
        <title>My Title</title>
        <link rel="canonical" href="http://mysite.com/example" />
    </Helmet>
    </div>
  );
}

export default App;
